  "text" : "朝、早い時間からケイタイの目覚ましが鳴り出して、自分は休みなのにそれに起こされて、とりあえず水を飲みに起きて戻ってきたけど持ち主はまだ起きてなくて、「朝だよ」って体叩いて起こすとその人は「んー」って言いつつ手を上げるので、私はその手を取り引っ張り上げて起こして「おはよ」って言う。",
