  "text" : "でも、議論（叱りや文句など一方的な主張を含む）のような感情が高ぶるようなことの後に「じゃあどうしよう」って冷静に次に行けない人が多いことも一応理解はしているので、具体的にはそういった人達への配慮が自分の課題なのだろう、と思っている。",
