  "id_str" : "215457159725592576",
  "text" : "「あなたの意見はそうなんですね。理解はしました。しかし私はこういう意見です。」で終われるのであれば終わらすこともできるけど、それはただの喧嘩別れというか決裂なので、何かしらの合意や進展が必要な場合は、そこからさらに「お互い違うことが分かった上でじゃあどうする」が大事。",
