  "id_str" : "215454993526956032",
  "text" : "で、私の場合は相手が普通の人だと、前者の時には「もう少し優しく言えないの？」とか言われることが多いし、後者の場合はまずそこまで行くのに「疲れた」と言われる事が多い。",
