  "id_str" : "215454059942002688",
  "text" : "つまり、前提条件が一緒なのにその推論で間違いがある場合、前提条件がそもそも違う場合。前者については、ひとつひとつ丁寧な解説によって理解してもらえるし理解できる。しかし後者の場合には、どこで違うのかまず条件をみつけ、見つけた後にその間の妥協点を探るか合意を諦めるかということになる。",
  "id" : 215454059942002688,
  "created_at" : "Wed Jun 20 14:40:25 +0000 2012",
