  "text" : "中学校の頃、6月、雨上がりの朝、中学校まで目の前の田んぼの横の通学路に大量に小さなアマガエルが発生してて、それが靴やら自転車やら自動車で潰されていて。下半身だけ潰れて手だけで動こうとしてるのとかもいて。そんな光景だったので、その日だけは遅刻しても怒られませんでした。",
