  "text" : "今実際にMac使ってる人で「Macってオシャレだし」という理由で使ってる人少なくないだろうし、そういう人の中で同じように「周囲とちょっと違うおれカッコイイ」が理由の人は多数派ぐらいいるんじゃなかろうか。 [l]",
