  "text" : "私がMacが好きじゃない理由は、対応アプリケーションの少なさとかUIの使いづらさもあるけど、第一にはパソコンが本体とセットになってて自分の好きなようにカスタマイズできないし、一部パーツだけアップグレードしたりできないしで、つまりかなり割高になるところです。 [l]",
