  "text" : "「ウィキペディアに書くときは必ず出典つけてね」とは言ってるけど、実際のところ、それが独自研究ではなく正しい事実だと世間的に広く認められたものなら、出典なしで加筆してもらっても構わないんですよ。質の高い記事とは認められませんが、内容が充実することは悪いことじゃないので。 #jawp",
