  "text" : "ちなみに、意見が対立していて、その根源が趣味嗜好思想など価値観の相違によるものであった場合、そこで更に対立を深めて相手を憎むのではなく、対立は埋まらないことを認識した上で妥協点を探るべき。というのが、 #jawp で学んだ重要なことの1つです。",
